import React, { useState } from 'react';
import RealGroceryCartService from './RealGroceryCartService.js';

const SearchTestPage = () => {
  const [testResults, setTestResults] = useState(null);
  const [isLoading, setIsLoading] = useState(false);

  // Simple test function to verify service methods
  const testServiceMethods = () => {
    try {
      console.log('Testing RealGroceryCartService methods...');

      // Test cleanIngredientName
      const cleanTest = RealGroceryCartService.cleanIngredientName('feta cheese 0.5 cup');
      console.log('cleanIngredientName test:', cleanTest);

      // Test convertToGenericSearch
      const genericTest = RealGroceryCartService.convertToGenericSearch('feta cheese');
      console.log('convertToGenericSearch test:', genericTest);

      // Test createMultipleSearchQueries
      const testIngredients = [
        { ingredient: 'feta cheese', quantity: 0.5, unit: 'cup' },
        { ingredient: 'garlic', quantity: 2, unit: 'cloves' }
      ];
      const queriesTest = RealGroceryCartService.createMultipleSearchQueries(testIngredients);
      console.log('createMultipleSearchQueries test:', queriesTest);

      alert(`Service methods test successful!\n\ncleanIngredientName: ${cleanTest}\nconvertToGenericSearch: ${genericTest}\ncreateMultipleSearchQueries: ${queriesTest.join(', ')}`);

    } catch (error) {
      console.error('Service methods test failed:', error);
      alert(`Service methods test failed: ${error.message}`);
    }
  };

  // Sample ingredients for testing
  const sampleIngredients = [
    {
      name: 'Pizza Ingredients',
      ingredients: [
        { ingredient: 'feta cheese', quantity: 0.5, unit: 'cup' },
        { ingredient: 'flatout flatbread', quantity: 1, unit: '' },
        { ingredient: 'garlic', quantity: 2, unit: 'cloves' },
        { ingredient: 'orange pepper', quantity: 0.5, unit: 'cup' },
        { ingredient: 'onion', quantity: 0.25, unit: 'cup' },
        { ingredient: 'bell pepper', quantity: 0.5, unit: 'cup' },
        { ingredient: 'spinacheaves', quantity: 1, unit: 'cup' },
        { ingredient: 'tomato', quantity: 0.5, unit: '' }
      ]
    },
    {
      name: 'Paneer Butter Masala',
      ingredients: [
        { ingredient: 'paneer', quantity: 200, unit: 'grams' },
        { ingredient: 'butter', quantity: 50, unit: 'grams' },
        { ingredient: 'onion', quantity: 1, unit: 'piece' },
        { ingredient: 'tomato', quantity: 2, unit: 'pieces' },
        { ingredient: 'garlic', quantity: 4, unit: 'cloves' },
        { ingredient: 'ginger', quantity: 1, unit: 'inch' },
        { ingredient: 'cream', quantity: 100, unit: 'ml' },
        { ingredient: 'spices', quantity: 1, unit: 'tsp' }
      ]
    },
    {
      name: 'Simple Salad',
      ingredients: [
        { ingredient: 'lettuce', quantity: 1, unit: 'head' },
        { ingredient: 'tomato', quantity: 2, unit: 'pieces' },
        { ingredient: 'cucumber', quantity: 1, unit: 'piece' },
        { ingredient: 'olive oil', quantity: 2, unit: 'tbsp' },
        { ingredient: 'salt', quantity: 1, unit: 'tsp' }
      ]
    }
  ];

  const testSearchQueries = (ingredients) => {
    try {
      setIsLoading(true);
      console.log('Testing search queries for ingredients:', ingredients);

      const queries = RealGroceryCartService.createMultipleSearchQueries(ingredients);
      console.log('Generated queries:', queries);

      const commonIngredients = RealGroceryCartService.getCommonIngredients(ingredients);
      console.log('Common ingredients:', commonIngredients);

      // Get generic mappings for display
      const genericMappings = ingredients.map(ingredient => {
        const name = typeof ingredient === 'string' 
          ? ingredient 
          : ingredient.ingredient || ingredient.name || '';
        const original = RealGroceryCartService.cleanIngredientName(name);
        const generic = RealGroceryCartService.convertToGenericSearch(name);
        return { original, generic, isChanged: original !== generic };
      });
      console.log('Generic mappings:', genericMappings);

      setTestResults({
        originalIngredients: ingredients,
        searchQueries: queries,
        commonIngredients: commonIngredients,
        genericMappings: genericMappings,
        timestamp: new Date().toLocaleTimeString()
      });

      // Actually open tabs with the search queries
      queries.forEach((query, index) => {
        setTimeout(() => {
          const searchUrl = `https://www.bigbasket.com/ps/?q=${encodeURIComponent(query)}`;
          window.open(searchUrl, '_blank', 'noopener,noreferrer');
          console.log(`Opened tab ${index + 1} with query: ${query}`);
        }, index * 500); // Delay each tab opening
      });

      console.log('Test results set successfully and tabs opened');
    } catch (error) {
      console.error('Error in testSearchQueries:', error);
      alert(`Error testing search queries: ${error.message}`);
    } finally {
      setIsLoading(false);
    }
  };

  const openGroceryApp = async (appKey, ingredients) => {
    try {
      const result = await RealGroceryCartService.addToCart(appKey, ingredients);
      alert(`Result: ${result.message}\n\nSearch queries: ${result.searchQueries?.join(', ') || 'N/A'}`);
    } catch (error) {
      alert(`Error: ${error.message}`);
    }
  };

  const openSearchTabs = (ingredients, appName = 'BigBasket') => {
    try {
      const queries = RealGroceryCartService.createMultipleSearchQueries(ingredients);

      // Define search URLs for different apps
      const searchUrls = {
        'BigBasket': 'https://www.bigbasket.com/ps/?q=',
        'Blinkit': 'https://blinkit.com/search?q=',
        'Zepto': 'https://www.zepto.in/search?q='
      };

      const baseUrl = searchUrls[appName] || searchUrls['BigBasket'];

      // Open tabs for each query
      queries.forEach((query, index) => {
        setTimeout(() => {
          const searchUrl = `${baseUrl}${encodeURIComponent(query)}`;
          window.open(searchUrl, '_blank', 'noopener,noreferrer');
          console.log(`Opened ${appName} tab ${index + 1} with query: ${query}`);
        }, index * 300); // Shorter delay for faster opening
      });

      alert(`‚úÖ Opened ${queries.length} tabs in ${appName} with search queries:\n\n${queries.map((q, i) => `${i + 1}. ${q}`).join('\n')}`);

    } catch (error) {
      console.error('Error opening search tabs:', error);
      alert(`Error opening search tabs: ${error.message}`);
    }
  };

  return (
    <div className="search-test-page">
      <div className="test-header">
        <h2>üîç Search Query Test</h2>
        <p>Test how ingredients are converted to search queries for grocery apps</p>

        <div style={{ display: 'flex', gap: '10px', marginTop: '10px' }}>
          <button 
            onClick={() => {
              console.log('Simple test button clicked');
              alert('SearchTestPage component is working!');
            }}
            style={{ padding: '8px 16px', backgroundColor: '#007bff', color: 'white', border: 'none', borderRadius: '4px' }}
          >
            üß™ Test Component
          </button>

          <button 
            onClick={testServiceMethods}
            style={{ padding: '8px 16px', backgroundColor: '#28a745', color: 'white', border: 'none', borderRadius: '4px' }}
          >
            üîß Test Service Methods
          </button>
        </div>
      </div>

      <div className="test-samples">
        <h3>Sample Dishes</h3>
        {sampleIngredients.map((dish, index) => (
          <div key={index} className="sample-dish">
            <h4>{dish.name}</h4>
            <div className="ingredients-list">
              {dish.ingredients.map((ingredient, idx) => (
                <span key={idx} className="ingredient-tag">
                  {ingredient.quantity} {ingredient.unit} {ingredient.ingredient}
                </span>
              ))}
            </div>
            <div className="dish-actions">
              <button 
                onClick={() => {
                  console.log('Test Search Queries button clicked for:', dish.name);
                  testSearchQueries(dish.ingredients);
                }}
                className="test-button"
              >
                üîç Test & Open Tabs
              </button>
              <button 
                onClick={() => openSearchTabs(dish.ingredients, 'BigBasket')}
                className="open-app-button"
                style={{ backgroundColor: '#ff6b35' }}
              >
                üõí BigBasket Tabs
              </button>
              <button 
                onClick={() => openSearchTabs(dish.ingredients, 'Blinkit')}
                className="open-app-button"
                style={{ backgroundColor: '#ff6b6b' }}
              >
                ‚ö° Blinkit Tabs
              </button>
              <button 
                onClick={() => openSearchTabs(dish.ingredients, 'Zepto')}
                className="open-app-button"
                style={{ backgroundColor: '#4ecdc4' }}
              >
                üöÄ Zepto Tabs
              </button>
            </div>
          </div>
        ))}
      </div>

      {isLoading && (
        <div className="test-results">
          <h3>üîÑ Processing...</h3>
          <p>Generating search queries and ingredient mappings...</p>
        </div>
      )}

      {testResults && testResults.searchQueries && (
        <div className="test-results">
          <h3>Test Results ({testResults.timestamp})</h3>

          <div className="result-section">
            <h4>üîç Generated Search Queries:</h4>
            <div className="queries-list">
              {testResults.searchQueries.map((query, index) => (
                <div key={index} className="query-item">
                  <span className="query-number">{index + 1}.</span>
                  <span className="query-text">{query}</span>
                </div>
              ))}
            </div>
          </div>

          <div className="result-section">
            <h4>üìã Ingredient Mappings (Original ‚Üí Generic):</h4>
            <div className="mappings-list">
              {testResults.genericMappings.map((mapping, index) => (
                <div key={index} className={`mapping-item ${mapping.isChanged ? 'changed' : 'unchanged'}`}>
                  <span className="original-term">{mapping.original}</span>
                  <span className="arrow">‚Üí</span>
                  <span className="generic-term">{mapping.generic}</span>
                  {mapping.isChanged && <span className="change-badge">‚úì</span>}
                </div>
              ))}
            </div>
          </div>

          <div className="result-section">
            <h4>üìã Common Ingredients (Prioritized):</h4>
            <div className="ingredients-list">
              {testResults.commonIngredients.map((ingredient, index) => (
                <span key={index} className="ingredient-tag">
                  {ingredient}
                </span>
              ))}
            </div>
          </div>

          <div className="result-section">
            <h4>üí° How It Works:</h4>
            <ul className="explanation-list">
              <li>‚úÖ <strong>Generic terms</strong> - "feta cheese" ‚Üí "cheese" (more results)</li>
              <li>‚úÖ <strong>Individual searches</strong> for common ingredients (cheese, garlic, onion)</li>
              <li>‚úÖ <strong>Grouped searches</strong> for related ingredients (pepper + tomato)</li>
              <li>‚úÖ <strong>Prioritized order</strong> - most common ingredients first</li>
              <li>‚úÖ <strong>Clean queries</strong> - removes quantities and units</li>
              <li>‚úÖ <strong>Multiple tabs</strong> - opens 2-4 search tabs for better results</li>
            </ul>
          </div>
        </div>
      )}
    </div>
  );
};

export default SearchTestPage;
